INSERT INTO `avisos` (`id`, `tipo`, `texto`, `fecha`, `textoTecnico`, `idTecnico`, `idUsuario`, `idFuncion`, `terminado`) VALUES
(1, 'Sugerencia', 'Esta es una sugerencia que pondría el alumno. Si el texto tiene mas de 200 caracteres deberían salir los 200 primeros y después tres puntos. El texto del técnico aparece entero en la pestaña modal. Muchas gracias por vuestra ayuda.', '2022-12-08', NULL, 2, 1, 7, 0),
(2, 'Felicitación', 'Muchas gracias por vuestro trabajo!', '2022-12-08', 'Denada, gracias por ayudarnos a mejorar dia a dia', 2, 3, 72, 1),
(3, 'Incidencia', 'He tenido un problema con Google Meet, no entiendo que sucede. No me deja iniciar sesión con mi correo de la universidad. ¿Me han echado de la facultad por no aprobar ni una? Por favor necesito ayuda urgente!! Tengo examen dentro de dos horas!! Igualmente creo que suspenderé porque no he estudiado nada. Muchas gracias.', '2022-12-08', 'Hola, estamos teniendo problemas con esto. Tu contraseña era muy debil y debes reiniciarla para evitar sufrir ataques, te adjunto por correo la forma de cambiarla.', 2, 1, 11, 1),
(5, 'Felicitación', 'Muchas gracias por vuestro servicio! Siempre teneis cervecitas frías.', '2022-12-14', NULL, NULL, 1, 79, 0),
(6, 'Felicitación', 'Muchas gracias por dejarme un cargador del móvil. ', '2022-12-14', 'Te mandan saludos', 2, 1, 70, 1),
(7, 'Incidencia', 'Hola, estaba utilizando la VPN que nos proporcionais en la UCM para intentar comprar armas en Siria. Creo que me ha pillado la interpol y estoy metido en un lio. ¿Hay forma de que me rastreen y me pillen?', '2022-12-14', NULL, NULL, 1, 14, 0),
(8, 'Sugerencia', '¿Se podría mejorar la interfaz del Moodle? La verdad que es bastante cutre y no me anima a estudiar, estoy apunto de dejar la carrera. Mi mujer me ha dejado y mis hijos no me quieren...', '2022-12-14', 'Intentamos mejorar constantemente la interfaz. Te paso por correo el número de los psicologos de la UCM, parece que te hace falta', 19, 1, 17, 1),
(11, 'Incidencia', 'No me funciona el wifi en ningun lado de la facultad. Ni si quiera me llegan los datos. Parece mentira que estemos en la facultad de informatica. Si esto continua asi voy a haceros una visita a la sala de técnicos, a ver si seguis ignorándome...', '2022-12-14', NULL, NULL, 3, 15, 0),
(12, 'Sugerencia', 'Podrías mejorar el cortafuegos? No me deja entrar en determinadas webs... Prefiero no decir que tipo de webs son. Creo que me salto el cortafuegos cuando intente entrar en un anuncio de unas pastillas que impulsaban la fuerza naval.', '2022-12-14', NULL, 15, 3, 13, 0),
(13, 'Incidencia', 'Puedo registrarme en esta web con un correo que no sea de la ucm?? Lo estoy intentando y no me deja... No podríais meterlo a pincho en la base de datos?? Mi correo es: pedrito@gmail.com', '2022-12-14', 'Este aviso ha sido eliminado por el técnico Rodolfo Hortelano Pérez debido a:\r\nLosiento, no es posible', NULL, 3, 8, 1),
(14, 'Felicitación', 'Muchas gracias a toda la universidad por vuestro buen servicio!', '2022-12-14', NULL, NULL, 3, 80, 0),
(15, 'Felicitación', 'Buenas, soy un antiguo alumno y me gustaría agradeceros vuestro buen trabajo. En toda mi etapa como estudiante de la UCM me habeis ayudado en todo. Gracias!', '2022-12-14', NULL, 15, 16, 80, 0),
(16, 'Incidencia', 'Estoy intentando unirme a una reunion de Google Meet con antiguos profesores y no me deja... Puede ser porque sea un antiguo alumno y ya no pueda entrar? Me estoy haciendo mayor', '2022-12-14', NULL, 19, 16, 4, 0),
(17, 'Sugerencia', 'Me gustaría poder mantener mi cuenta de alumno para tener guardados los apuntes que me fueron poniendo mis profesores. Me vais a cerrar esta cuenta ya que ya no soy estudiante??', '2022-12-14', 'No te preocupes, la cuenta se te quedara de por vida.', 2, 16, 5, 1),
(27, 'Incidencia', 'Hoy he intentado traer a mi hijo al mi humilde despacho para que viese donde trabaja su padre y no ha podido conectarse al wifi. Pretendía tenerle viendo pepa pig mientras yo investigaba ordenadores cuánticos pero ha estado toda la mañana dandome la turra con sus tonterias. ME HABEIS ARRUINADO EL DIA', '2022-12-14', 'LOSIENTO POR ARRUINARTE EL DIA. Tu hijo no ha podido conectarse porque el dispositivo no esta registrado en la lista de dispositivos que acepta la red, la próxima vez que vea pepa pig desde tu ordenador.', 2, 17, 56, 1),
(28, 'Felicitación', 'Muchas gracias por arreglarme la luz el otro dia!', '2022-12-14', 'Denada, es importante poder ver!', 15, 17, 74, 1),
(31, 'Sugerencia', 'El wifi de visitantes va mejor que el normal, a ver si vamos cambiando estas cositas...', '2022-12-14', 'Este aviso ha sido eliminado por el técnico Tecnico CAU debido a:\r\nLos wifis \"van\" con la misma velocidad.', 19, 17, 57, 1),
(32, 'Incidencia', 'No me deja entrar en la pagina de analiticas de web. Creo que he olvidado la contraseña, me la podeis restaurar?', '2022-12-14', NULL, 2, 18, 39, 0),
(33, 'Felicitación', 'Muchas gracias por imprimirme los periodicos del Marca! Ya podre entretenerme cuando no tenga conexión', '2022-12-14', 'Jejeje, asi te mantienes informado!', 19, 18, 78, 1),
(34, 'Sugerencia', 'Hay alguna forma de poder entrar a moodle con mi cuenta personal?? No me gusta usar el correo de la UCM, prefiero tenerlo todo en una cuenta. Estaría bien que implementaseis esto', '2022-12-14', 'Este aviso ha sido eliminado por el técnico Francisco Carrero Negro debido a:\r\nNo es posible.', 15, 18, 27, 1),
(36, 'Felicitación', 'Muchas gracias por vuestro buen servicio! Aunque a veces os pasais con las inspecciones se os quiere', '2022-12-14', NULL, 2, 18, 73, 0);

